import React from 'react';

const ExercisesList = ({ exercises }) => {
    return (
        <div>
                <div>

                    <h3>Logged Exercises</h3>

                    <table className="table">
                        <thead className="thead-light">
                            <tr>
                                <th>{exercises.username} </th>
                                <th>Description </th>
                                <th>Duration </th>
                                <th>Date</th>
                                <th>Actions</th>
                            </tr>
                        </thead>
                        <tbody>

                        </tbody>
                    </table>
                    ))}
                </div>
        </div>
    )
}
export default ExercisesList;
